import React, { useState, useEffect } from 'react'
import { json, useLocation, useNavigate } from "react-router-dom"
import Navbar from "./Navbar";
import NavbarAccount from "./NavbarAccount"
import "./assets/css/main.css";


const LoginPage = () => {
	const [session, setNotes] = useState([
		{
			email: 'Empty',
			password: 'Empty',
		},
    ]);

    useEffect(() => {
		const savedNotes = JSON.parse(
			localStorage.getItem('session')
		);

		if (savedNotes) {
			setNotes(savedNotes);
		}
    }, []);

    useEffect(() => {
		localStorage.setItem(
			'session',
			JSON.stringify(session)
		);
    }, []);

    const navigate = useNavigate();
    const path = useLocation();

    let ses = session;

    let nav = '';

    if (ses === '[{"email":"Empty","password":"Empty"}]') {
	   nav = <NavbarAccount />
	} else {
	   nav = <Navbar />
    }

  	return (
    <div id="page-wrapper">
      <Navbar />

      <div id="footer" style={{ background: "white" }}>
			<div className="container" style={{ background: "white", marginBottom: "-5%" }}>
				<div className="auth">
					<section className="6c 12u(narrower) 12u$(mobilep)">
						<h3>Авторизація</h3>
						<form>
							<div className="row 100%">
								<div className="12u 12u(mobilep)">
									<input type="email" name="email" id="email" placeholder="Ваша електронна пошта"/>
								</div>
							</div>
							<div className="row 50%">
								<div className="12u 12u(mobilep)">
									<input type="text" name="name" id="name" placeholder="Пароль"/>
								</div>
							</div>
							<div className="row 50%">
								<div className="12u">
									<ul className="actions" style={{ marginBottom: "20px" }}>
										<li><input type="submit" className="button alt" value="Увійти"/></li>
									</ul>
								</div>
							</div>
						</form>
						<br></br>
					</section>
					<div style={{ display: "flex", height: "30px" }}>
					<p>Забули пароль?</p><a href="#" style={{ marginLeft: "2%" }}><b>Нагадати</b></a>
				</div>
				</div>
			</div>

			<br></br>
			<br></br>
			<br></br>
			<br></br>
			<div className="copyright">
				<ul className="menu">
					<li>&copy; JavaScript. All rights reserved</li><li>Design: <a href="http://">Tockyj Bohdan</a></li>
				</ul>
        	</div>
		</div>
    </div>
  );
};

export default LoginPage
